import React, { ReactElement } from "react";
import styles from "../styles/layout/modal.css";

function ModalBasic({ setModalOpen }): JSX.Element {
	// 모달 끄기
	const closeModal = () => {
		setModalOpen(false);
	};

	return (
		<div className={styles.container}>
			<button className={styles.close} onClick={closeModal}>
				X
			</button>
			<p>모달창입니다.</p>
		</div>
	);
}
export default ModalBasic;
